import ParticipantListCard from "./ParticipantListCard"
// STEP 2: Import useLoader Data
import { useLoaderData } from 'react-router-dom'

function ParticipantList() {


  //STEP 3: Add the loader data for the participants, using destructuring
  const { participants } = useLoaderData()

  const mappedCards = participants.map(participantObj => (
    <ParticipantListCard key={participantObj.id} participantObj={participantObj} />
  ))

  return (
    <div className="participant-list">
      { mappedCards }
    </div>
  )
}

export default ParticipantList
